import react from "react"
import ReactDOM from "react-dom/client"
import "./style.css"

const root = ReactDOM.createRoot(document.getElementById("root"))

//NAVBAR COMPONENT
function Navbar()
{
  return(
    <nav>
      <h1>Perfumy</h1>
      <ul>
        <li>Home | </li>
        <li>Products | </li>
        <li>About | </li>
        <li>Contact </li>
      </ul>
    </nav>
  )
}

//SEARCH BAR COMPONENTS
function Search()
{
  return(
    <div className="searchbar">
      <input type="text" placeholder="search"/>
    </div>
  )
}

//PRODUCT COMPONENTS
function Product()
{
  return(
    <div className="products">
    <div className="box">
      <img src="./assets/images/one.j"></img>
    </div>

    </div>
  )
}

root.render(
  <div>
    <Navbar></Navbar>
    <Search></Search>
  </div>
)
